export default (state = {}, action) => {
    if(action.type === "FETCH_USER"){
        const id = action.payload.id;
        const name = action.payload.name;
        console.log(state, id, name);
        if(action.payload)
            return {...state, id: name };
        else
            return state;
    }

    return state;
}
